import path from 'path';
import fs from 'fs';
import { errorResponse } from "./src/server/functions/response"

import { valhallaSimpleUpload } from 'valhalla-cloud';

async function subirArchivo({ base64Data, fileName }: any): Promise<any> {
    try {
        // Convertir archivo a base64 si no viene en ese formato
        let dataBase64 = base64Data;

        // Si fileName es una ruta de archivo, leerlo y convertirlo a base64
        if (!base64Data && fileName && fs.existsSync(fileName)) {
            const fileBuffer = fs.readFileSync(fileName);
            dataBase64 = fileBuffer.toString('base64');
            // Extraer el nombre del archivo de la ruta
            fileName = path.basename(fileName);
        }

        const resultado = await valhallaSimpleUpload({
            base64Data: dataBase64,
            isPublic: true,
            name: fileName || "generateUUID",
        });

        console.log('✅ Subida exitosa:', resultado);

        return resultado

    } catch (error) {
        console.error('❌ Error subiendo archivo:', error);
        return errorResponse({ message: "❌ Error subiendo archivo" })
    }
}

async function ejecutar() {
    const resultado = await subirArchivo({
        fileName: "hola",
        base64Data: ""
    });

    console.log('Resultado final:', resultado);
}

// Ejecutar y manejar errores
ejecutar().catch(console.error);
